import React from 'react';
import PropType from 'prop-types';
import { FormControl, Form, Navbar, Button, Image } from 'react-bootstrap';
import { NavHeader, Search, LandingPage } from './HeaderStyle';
import { ButtonSearch } from '../Buttons/Button';
import { colors } from '../../styles/styles';

const Header = ({
    titleBrand, labelButton, value, onChange, onClick
}) => (
  <div>
    <Navbar className="d-flex">
      {/* <Navbar.Brand href="#home">AwesomePokedex</Navbar.Brand> */}
    </Navbar>
    <LandingPage className="d-flex align-items-center flex-column">
      <h1>AwesomePokedex</h1>
      <p>
        This is a simple hero unit, a simple jumbotron-style component for calling
        extra attention to featured content or information.
      </p>
      <Image src={require('../../img/pokedex-icon-19.jpg')} fluid />
      <p>
        <Button variant="primary">Learn more</Button>
      </p>
    </LandingPage>
  </div>
);

Header.propTypes = {
  titleBrand: PropType.string,
  labelButton: PropType.string,
  value: PropType.string,
  onChange: PropType.func,
  onClick: PropType.func,
};

export default Header;
